const People = (props) => {

    return(
    <div className='people'>
        <p className='people__name'>{props.data.name}</p>
        <p className='people__homeworld'>{props.data.species.name !== NULL ? props.data.species.name: 'Human'}+{' from '}+{props.data.homeworld.name}</p>
    </div>)

}

export default People;
